function fearNotLetter(str) {
  /*Find the missing letter in the passed letter range and return it.

  If all letters are present in the range, return undefined.*/

  //declare variables
  let start;
  let end;
  let finalStr=[];

  //find start and end character
  start=str.charCodeAt(0);
  end=str.charCodeAt(str.length-1);

  //check if no missing
  if (end-start == str.length-1) {
    console.log('nothing missing');
    return undefined;
  }


  for (let j=0;j<str.length;j++) {
    if (str[j]!=String.fromCharCode(start)) {
      console.log("str is missing a "+String.fromCharCode(start));
      return String.fromCharCode(start);
    } else {
      start++;
    }
  }




}

